  assemblies:
  - netDxf
  namespace: netDxf.Collections
  summary: Deletes a layout and removes the layout entities from the document.
  remarks: >-
    The ModelSpace layout cannot be removed. If all PaperSpace layouts have been removed a default PaperSpace will be created since it is required by the DXF implementation.<br />

    When a Layout is deleted all entities that has been added to it will also be removed.<br />

    Removing a Layout will rebuild the PaperSpace block names, to follow the naming rule: Paper_Space, Paper_Space0, Paper_Space1, ...
  example: []
  syntax:
    content: public override bool Remove(string name)
    parameters:
    - id: name
      type: System.String
      description: <xref href="netDxf.Objects.Layout?text=Layout" data-throw-if-not-resolved="false"></xref> name to remove from the document.
    return:
      type: System.Boolean
      description: True if the layout has been successfully removed, or false otherwise.
    content.vb: Public Overrides Function Remove(name As String) As Boolean
